_edit_date`,`last_editor_display_name`,`last_editor_user_id`,`owner_display_name`,`owner_user_id`,`parent_id`,`post_type_id`,`score`,`tags`,`view_count`) VALUES (78257548, 'How to use external assembler function in C using CMake as build tool', '<p>Im trying to learn how to write my own x86_64 assembler functions (or maybe subroutines is the correct word) that can be called with a C function wrapper from a static library. However i cant even get it to build, since im getting the error</p>\\n<pre><code>Building ASM object CMakeFiles/test_asm.dir/src/test.asm.obj\\nAssembler messages:\\nError: operand size mismatch for `mov\\'\\n</code></pre>\\n<p>My machine has a AMD Ryzen 5 5600G processor which says AMD64 but to my understanding this is the same as x86_64</p>\\n<p>I have tried making this very simple test to start off but i suspect that the build options arent quite right because gcc doesnt seem to understand the assembly code i have written. The assembly code is taken from a C function that does the same thing but &quot;disassembled&quot; into assembly using compiler explorer.</p>\\n<p>The CMakeLists file</p>\\n<pre><code>cmake_minimum_required(VERSION 3.20)\\n\\nproject(\\n    CwithASM\\n    LANGUAGES C ASM\\n    VERSION 0.0.1\\n    DESCRIPTION &quot;Test project for C with ASM&quot;\\n)\\n\\nset(CMAKE_C_STANDARD 17)\\n\\nset_property(SOURCE src/test.asm APPEND PROPERTY COMPILE_OPTIONS &quot;-x&quot; &quot;assembler-with-cpp&quot;)\\n\\nadd_library(\\n    ${PROJECT_NAME} STATIC\\n    src/test.c\\n    src/test.h\\n)\\n\\nadd_library(\\n    test_asm OBJECT\\n    src/test.asm\\n)\\n\\ntarget_compile_features(${PROJECT_NAME} PRIVATE c_std_17)\\ntarget_link_libraries(${PROJECT_NAME} PRIVATE test_asm)\\n</code></pre>\\n<p>The test.asm file</p>\\n<pre><code>test_ret_2:\\n    push    rbp\\n    mov     rbp, rsp\\n    mov     eax, 2\\n    pop     rbp\\n    ret       \\n</code></pre>\\n<p>The test.c file</p>\\n<pre><code>#include &quot;test.h&quot;\\n#include &quot;test.asm&quot;\\n#include &lt;stdio.h&gt;\\n\\nextern int test_ret_2();\\n\\nint test() {\\n    int val = test_ret_2();\\n    return val;\\n}\\n</code></pre>\\n', NULL, 0, 0, NULL, '2024-04-01 20:04:34', 0, '2024-04-01 20:04:34', NULL, NULL, NULL, 'willaayy', 22242489, NULL, 1, 0, 'c,assembly,cmake,x86,x86-64', 2), (74127836, 'Your manifest file doesn&#39;t include the com.google.android.gms.permission.AD_ID permission', '<p>I\\'m getting the following error when trying to submit my app to the Play Store:</p>\\n<blockquote>\\n<p>Your declaration on Play Console says that your app uses advertising ID. Your manifest file doesn\\'t include the com.google.android.gms.permission.AD_ID permission.</p>\\n</blockquote>\\n<p>I\\'ve already declared the <code>AD_ID</code> permission in my <code>AndroidManifest.xml</code> file, as follows:</p>\\n<pre><code> &lt;uses-permission android:name=&quot;com.google.android.gms.permission.AD_ID&quot;/&gt;\\n</code></pre>\\n<p>My app\\'s <code>targetSdk</code> version is <code>33</code> and the AdMob ads library version that I have included is <code>21.3.0</code>, as follows:</p>\\n<pre><code>  implementation \\'com.google.android.gms:play-services-ads:21.3.0\\'\\n</code></pre>\\n<p>I\\'ve follow every step in the <a href=\\\"https://developers.google.com/admob/android/quick-start\\\" rel=\\\"noreferrer\\\">AdMob Get Started</a> guide and it doesn\\'t work.</p>\\n', NULL, 6, 0, NULL, '2022-10-19 15:12:28', 0, '2024-04-01 20:04:34', '2023-07-28 09:53:56', 'Adil Hussain', 1071320, 'Julia', 1391580, NULL, 1, 22, 'google-play-services,android-manifest,android-permissions', 11399), (78257550, 'How to listen to user scroll event in Vue 3 for a chat app that has an auto scroll?', '<p>I am working on a chat app using Vue 3 and composition API. The app uses code that scrolls the last message into view as it is generated like so:</p>\\n<pre><code>watchEffect(\\n    () =&gt; {\\n        if (messages.value.length) {\\n            chatContainer.v(len:10117)", "3EDFHZJX5iSzvfr.etl", "gharchive_dev", "Insert", from_unixtime(1712001865), from_unixtime(1712001925), 0, 0, 0, 0, 0, 6605187, 0, "stackoverflow.questions");
