y deserialization. please view: <a href=\\\"https://stackoverflow.com/questions/78257427/how-to-provide-brand-new-jackson-deserialization-for-object\\\" title=\\\"how to provide brand new jackson deserialization for object\\\">stackoverflow.com/questions/78257427/&hellip;</a>', '2024-04-01 20:05:05', 'Tao Chen', 5514444, 78257056, 'answer', 0), (137965524, '@Barmar, i&#39;ve put in the entirety of the code and the api', '2024-04-01 20:05:12', 'nijhof.ngsvn', 20398490, 78257457, 'question', 0) ON DUPLICATE KEY UPDATE `text`=VALUES(`text`),`creation_date`=VALUES(`creation_date`),`user_display_name`=VALUES(`user_display_name`),`user_id`=VALUES(`user_id`),`post_id`=VALUES(`post_id`),`post_type`=VALUES(`post_type`),`score`=VALUES(`score`)", "3EDFHZJX5iSzvfr.etl", "gharchive_dev", "Insert", from_unixtime(1712001865), from_unixtime(1712001925), 0, 0, 0, 0, 0, 10835660, 0, "stackoverflow.comments");
